window.bookSummaryJSON = "<p>Lord Kadorax Darkarrow was born on Earth, but in Agglor, he's the highest-level assassin anyone can find. The leader of the famed Blackened Blades, he's made a name for himself, built a kingdom of sorts, and only had to respawn once along the way. </p> <p>Then a rogue band of jackals sends him all the way back to a dreary tavern in a tiny village to start over at level one. </p> <p>Hellbent on revenge, Kadorax sets out on a path littered with bodies - level up, find the jackals, slay their god!</p>"; 
